import React from "react";

import styles from "./User.module.css";

function User(){

    return (
    <form className={styles.user}>
        <label>Username</label>
        <input type="text" />
        <label>Age(Years)</label>
        <input type="number" />
        <button type="submit">Add User </button>
    </form>
    )


}

export default User;
